import React from 'react'
import UserItem from './UserItem'
import users from './Users.module.css'

const Users = (props) => {

    return (
        <div>
        {props.items.map((user) => {
            <UserItem
                key={user.id}
                name={user.name}
                age={user.age}
            />
        })};
        </div>
    );

};

export default Users;
